import React from 'react';
import FontLightBox from './add-font';
import JSONLightBox from './add-json';

export default function LightBox({
  setShowFontLightBox,
  setShowJSONLightBox,
  setNewData,
  sheet,
  showFontLightBox,
  showJSONLightBox,
}) {
  return (
    <>
      {showFontLightBox && (
        <FontLightBox
          setShowFontLightBox={setShowFontLightBox}
          setNewData={setNewData}
          sheet={sheet}
        />
      )}

      {showJSONLightBox && (
        <JSONLightBox
          setShowJSONLightBox={setShowJSONLightBox}
          setNewData={setNewData}
          sheet={sheet}
        />
      )}
    </>
  );
}
